import React from "react";
import { Row, Col, Input, Modal, Typography } from "antd";

const { Text } = Typography;
const CustomModal = ({ visible, onSubmit, onCancel, data }) => {
  return (
    <Modal
      title="Edit info"
      visible={visible}
      onOk={onSubmit}
      onCancel={onCancel}
    >
      {/* {item_data === ""
        ? console.log("null")
        : item_data.map(el => <p>{el.name}</p>)} */}
      {data === null ? console.log("error") : console.log(data.name)}
    </Modal>
  );
};

export default CustomModal;
